import static org.assertj.core.api.Assertions.assertThat;
import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertTrue;
import static org.mockito.Mockito.mock;

import java.util.List;
import java.util.Set;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import org.springframework.samples.petclinic.vet.Specialty;
import org.springframework.samples.petclinic.vet.Vet;

@ExtendWith(MockitoExtension.class)
public class VetTest {

	private Vet instance;

	@Mock
	private Specialty specialty;

	@Mock
	private Specialty anotherSpecialty;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("getSpecialtiesInternal should return empty set initially")
	void getSpecialtiesInternal_emptySet() {
		// Given

		// When
		int result = instance.getNrOfSpecialties();

		// Then
		assertEquals(0, result);
	}

	@Test
	@DisplayName("getSpecialtiesInternal should return set with added specialties")
	void getSpecialtiesInternal_withSpecialties() {
		// Given
		instance.addSpecialty(specialty);

		// When
		List<Specialty> result = instance.getSpecialties();

		// Then
		assertThat(result).contains(specialty);
	}

	@Test
	@DisplayName("getSpecialties should return empty list initially")
	void getSpecialties_emptyList() {
		// Given

		// When
		List<Specialty> result = instance.getSpecialties();

		// Then
		assertThat(result).isEmpty();
	}

	@Test
	@DisplayName("getSpecialties should return list with added specialties")
	void getSpecialties_withSpecialties() {
		// Given
		instance.addSpecialty(specialty);

		// When
		List<Specialty> result = instance.getSpecialties();

		// Then
		assertThat(result).contains(specialty);
	}

	@Test
	@DisplayName("getNrOfSpecialties should return zero initially")
	void getNrOfSpecialties_zero() {
		// Given

		// When
		int result = instance.getNrOfSpecialties();

		// Then
		assertEquals(0, result);
	}

	@Test
	@DisplayName("getNrOfSpecialties should return count of added specialties")
	void getNrOfSpecialties_withSpecialties() {
		// Given
		instance.addSpecialty(specialty);
		instance.addSpecialty(anotherSpecialty);

		// When
		int result = instance.getNrOfSpecialties();

		// Then
		assertEquals(2, result);
	}

	@Test
	@DisplayName("addSpecialty should add specialty to empty set")
	void addSpecialty_toEmpty() {
		// Given

		// When
		instance.addSpecialty(specialty);

		// Then
		assertTrue(instance.getSpecialties().contains(specialty));
	}

	@Test
	@DisplayName("addSpecialty should allow duplicates (edge case)")
	void addSpecialty_duplicate() {
		// Given
		instance.addSpecialty(specialty);

		// When
		instance.addSpecialty(specialty); // Adding duplicate

		// Then
		assertEquals(1, instance.getNrOfSpecialties()); // Assuming set behavior, unique
	}

}
